n, men kan vid behov enkelt rensas tidigare av administratören. Det är möjligt att vi använder molntjänster från QUIC.cloud för att bearbeta och tillfälligt spara dina data.','Disabling this may cause WordPress tasks triggered by AJAX to stop working.'=>'Om detta inaktiveras kan WordPress-åtgärder som utlöses av AJAX sluta fungera.','right now'=>'just nu','just now'=>'precis nu','Saved'=>'Sparad','Last ran'=>'Senast körd','You will be unable to Revert Optimization once the backups are deleted!'=>'Du kommer inte att kunna återställa optimeringen efter att säkerhetskopiorna har tagits bort!','This is irreversible.'=>'Detta är oåterkalleligt.','Remove Original Image Backups'=>'Ta bort säkerhetskopiorna för originalbild','Are you sure you want to remove all image backups?'=>'Är du säker på att du vill ta bort alla säkerhetskopior av bilder?','Total'=>'Totalt','Files'=>'Filer','Last calculated'=>'Senast beräknad','Calculate Original Image Storage'=>'Beräkna lagringsutrymme för bildoriginal','Storage Optimization'=>'Lagringsoptimering','Use the format %1$s or %2$s (element is optional).'=>'Använd formatet %1$s eller %2$s (element är valfritt).','Only attributes listed here will be replaced.'=>'Endast attribut listade här kommer att ersättas.','Only files within these directories will be pointed to the CDN.'=>'Bara filer i dessa kataloger kommer att peka mot CDN:et.','Included Directories'=>'Inkluderade kataloger','A Purge All will be executed when WordPress runs these hooks.'=>'En ”Töm allt” kommer utföras när WordPress kör dessa åtgärds-hookar.','Purge All Hooks'=>'Töm alla åtgärds-hookar','Purged all caches successfully.'=>'All cache tömdes.','LSCache'=>'LSCache','Forced cacheable'=>'Tvingad cachebarhet','Paths containing these strings will be cached regardless of no-cacheable settings.'=>'Sökvägar som innehåller dessa strängar kommer att cachelagras oavsett om inställningar anger att de ska cachelagras.','Force Cache URIs'=>'Tvinga cachelagring av URI:er','Exclude Sett