ges'=>'Töm sidor','Cancel'=>'Avbryt','Activate'=>'Aktivera','Email Address'=>'E-postadress','Install Now'=>'Installera nu','Purged the blog!'=>'Tömde bloggen!','Purged All!'=>'Tömde allt!','Notified LiteSpeed Web Server to purge error pages.'=>'Meddelade LiteSpeed-webbserver att tömma felsidor.','If using OpenLiteSpeed, the server must be restarted once for the changes to take effect.'=>'Om du använder OpenLiteSpeed måste servern startas om en gång för att ändringarna ska träda i kraft.','If the login cookie was recently changed in the settings, please log out and back in.'=>'Om cookien för inloggning nyligen ändrades i inställningarna, logga ut och in igen.','However, there is no way of knowing all the possible customizations that were implemented.'=>'Det finns dock inget sätt att känna till alla möjliga anpassningar som implementerades.','The LiteSpeed Cache plugin is used to cache pages - a simple way to improve the performance of the site.'=>'LiteSpeed Cache-tillägget används för att cachelagra sidor – ett enkelt sätt att förbättra webbplatsens prestanda.','The network admin setting can be overridden here.'=>'Inställningen för nätverksadministratören kan åsidosättas här.','Specify how long, in seconds, public pages are cached.'=>'Specificera hur länge i sekunder offentliga sidor är cachelagrade.','Specify how long, in seconds, private pages are cached.'=>'Specificera hur länge i sekunder privata sidor är cachelagrade.','Purge pages by post ID.'=>'Töm sidor efter inläggs-ID.','Purge the LiteSpeed cache entries created by this plugin'=>'Töm LiteSpeed-cacheinläggen som skapats av detta tillägg','Purge %s error pages'=>'Töm %s felsidor','This will Purge Front Page only'=>'Detta kommer endast tömma startsidan','Purge pages by tag name - e.g. %2$s should be used for the URL %1$s.'=>'Töm sidor efter etikettnamn – t.ex. bör %2$s användas för URL:en %1$s.','Purge pages by category name - e.g. %2$s should be used for the URL %1$s.'=>'Töm sidor efter kategorinamn – t.ex. b